import 'ol/ol.css';
import Map from 'ol/Map';
import View from 'ol/View';
import TileLayer from 'ol/layer/Tile';
import {getWidth, getCenter} from 'ol/extent';
import {Layer, Tile} from 'ol/layer';
import {OSM, TileDebug} from 'ol/source';
import TileWMS from 'ol/source/TileWMS';
import {transform} from 'ol/proj';
import SourceState from 'ol/source/State';
import {fromLonLat, toLonLat} from 'ol/proj';

var dict=require('./data.js');
console.log('loading');
console.log(dict.data[0]);

var episode=dict.data[0];

var CanvasLayer = /*@__PURE__*/(function (Layer) {
  function CanvasLayer(options) {
    Layer.call(this, options);

    this.features = options.features;
    this.paths = options.paths;
    this.svg = d3.select(document.createElement('div')).append('svg')
      .style('position', 'absolute');

    this.svg.append('path')
      .datum(this.features)
      .attr('class', 'zebra')
      .attr('style', 'color:#00f;');
  }

  if ( Layer ) CanvasLayer.__proto__ = Layer;
  CanvasLayer.prototype = Object.create( Layer && Layer.prototype );
  CanvasLayer.prototype.constructor = CanvasLayer;

  CanvasLayer.prototype.getSourceState = function getSourceState () {
    return SourceState.READY;
  };

  CanvasLayer.prototype.render = function render (frameState) {
    var width = frameState.size[0];
    var height = frameState.size[1];
    var projection = frameState.viewState.projection;
    var d3Projection = d3.geoMercator().scale(1).translate([0, 0]);
    var d3Path = d3.geoPath().projection(d3Projection);

    var pixelBounds = d3Path.bounds(this.features);
    var pixelBoundsWidth = pixelBounds[1][0] - pixelBounds[0][0];
    var pixelBoundsHeight = pixelBounds[1][1] - pixelBounds[0][1];

    var geoBounds = d3.geoBounds(this.features);
    var geoBoundsLeftBottom = fromLonLat(geoBounds[0], projection);
    var geoBoundsRightTop = fromLonLat(geoBounds[1], projection);
    var geoBoundsWidth = geoBoundsRightTop[0] - geoBoundsLeftBottom[0];
    if (geoBoundsWidth < 0) {
      geoBoundsWidth += getWidth(projection.getExtent());
    }
    var geoBoundsHeight = geoBoundsRightTop[1] - geoBoundsLeftBottom[1];

    var widthResolution = geoBoundsWidth / pixelBoundsWidth;
    var heightResolution = geoBoundsHeight / pixelBoundsHeight;
    var r = Math.max(widthResolution, heightResolution);
    var scale = r / frameState.viewState.resolution;
console.log(scale);
    var center = toLonLat(getCenter(frameState.extent), projection);
    d3Projection.scale(scale).center(center).translate([width / 2, height / 2]);

    d3Path = d3Path.projection(d3Projection);
    d3Path(this.features);

    this.svg.attr('width', width);
    this.svg.attr('height', height);

    this.svg.select('path')
      .attr('d', d3Path);

    return this.svg.node();
  };

  return CanvasLayer;
}(Layer));




var map = new Map({
  layers: [
    new TileLayer({
      source: new OSM()
    }),
    new TileLayer({
       source: new TileWMS({
          url: 'http://cetsp1.cetsp.com.br:10084/geoserver/cetmdc/wms',
          params: {
            'LAYERS': 'cetmdc:mdcViario_lg',
            'TILED': true,
            'service': 'WMS',
            'version': '1.1.0',
            'request': 'GetMap',
            'layers': 'cetmdc:mdcViario_lg'
          },
          serverType: 'geoserver'
       })
    })
  ],
  target: 'map',
  view: new View({
    center: transform([episode.info.longitude, episode.info.latitude], 'EPSG:4326', 'EPSG:3857'),
    zoom: episode.info.zoom
  })
});


var f={
    features: {
        type: "FeatureCollection",
        features: episode.info.paths.map(function(p, index){
            return {
                type: "Feature",
                id: index,
                properties: {},
                geometry:{
                    type: "LineString",
                    coordinates: p.geom.map(function(g){
                        return [g.longitude, g.latitude];
                    }),
                    style: function(){
                        return "stroke:#0f0";
                    }
                },
                style: function(){
                    return "stroke:#0f0";
                }
            };
        }),
        style: function(){
            return "stroke:#0f0";
        }

    }
};


var layer = new CanvasLayer(f);
map.addLayer(layer);
